import React from 'react'
import NavButton from './NavButton/NavButton'
import './NavBar.css'

import * as Scroll from 'react-scroll';
import { Link, Element , Events, animateScroll as scroll, scrollSpy, scroller } from 'react-scroll'

function NavBar(props) {

    return (
        <div className='nav-bar'>
            <NavButton name="Education" id='education' handlePageChange={props.handlePageChange}/>
            <NavButton name="Projects" id='projects' handlePageChange={props.handlePageChange}/>
            <NavButton name="Contact" id='contact' handlePageChange={props.handlePageChange}/>
            <Link activeClass="active" to="education" spy={true} smooth={true} offset={50} duration={500} onSetActive={this.handleSetActive}>
          Test 1
        </Link>
        </div>
    )

    }

export default NavBar;
